import React from 'react';
import Button from '../Button/Button';

function Input({ value, onChange, placeholder}) {

    return (
        <>
            <input
                type='text'
                value={value}
                onChange={onChange}
                placeholder={placeholder}
                style={{
                    listStyle: 'none',
                    width: '300px',
                    padding: '5px',
                    borderLeft: 'none',
                    borderRight: 'none',
                    borderTop: 'none',
                }}
            />
            <Button color='#007BFF' title='Add Player' type='button'  />
            <Button title='Remove Player' type='button' color='red'  />
        </>

    );
}

export default Input;
